// DesignAdvertising.js
// Detailed page for design and advertising services.

import React from 'react';
import { Link } from 'react-router-dom';

const DesignAdvertising = () => {
  return (
    <div className="service-page">
      <h1>Дизайн и реклама</h1>
      <img
        src={process.env.PUBLIC_URL + '/img/design.png'}
        alt="Дизайн и реклама"
        className="service-page__image"
      />
      <p>
        Разрабатываем макеты и рекламные материалы для вашего бизнеса. Создаём
        фирменный стиль, логотипы, баннеры и креативные концепции. Мы
        внимательно изучаем ваш бренд и предлагаем индивидуальные решения.
      </p>
      <p><strong>Стоимость:</strong> от 500 ₽ за макет.</p>
      <p><strong>Срок исполнения:</strong> от 2 дней.</p>
      <Link to="/services" className="btn btn-primary">
        Вернуться к услугам
      </Link>
    </div>
  );
};

export default DesignAdvertising;
